import React from 'react'
import { BrowserRouter,Routes,Route,Link } from 'react-router-dom';
export default function App() {
  return (
      <BrowserRouter>
       <ul>
      <li>
      <Link to='/PageAPI'>Comp1</Link>
      <Link to='/PageForm'>Comp1</Link>
      <Link to='/Page'>Comp1</Link>
      </li>
     </ul>
      </BrowserRouter>
  )
}
